import React from 'react';
import Logo from '../logoHenry.png'
import SearchBar from './SearchBar.jsx';
import './Nav.css';
import Cards from './components/Cards.jsx'

function Nav({onSearch}) {
  return (
    <div className= "search">
      <img src={Logo}/>
      <SearchBar onSearch={onSearch}/>
    </div>
  );
};

export default Nav;
